Solution: Here is a possible implementation of the onSubmit function in React:
```js
import axios from 'axios';

const onSubmit = async (values) => {
  try {
    const response = await axios.post('https://api.example.com/graphql', {
      query: `mutation($input: Input!) { create(input: $input) { id } }`,
      variables: {
        input: values,
      },
    });

    return response.data.data.create.id;
  } catch (error) {
    return error.message;
  }
};
```
This function uses the Axios library to make a POST request to the GraphQL API endpoint. It passes the form values as input to the mutation query. If the request succeeds, it returns the ID of the created user. If the request fails, it returns the error message.

